class GetdataComponent extends Component {

    constructor(props) {
        super(props)
        this.state = {
            list_data:[]
        }
    }

    componentDidMount() {
   axios.get('https://jsonplaceholder.typicode.com/posts').then(response=>{
console.log(response)
   }).catch(error=>{
       console.log(error)
   })

    }




    render() {
        return (
            <div>hello</div>
        )
